import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const MinhasTarefas = () => {
  const navigate = useNavigate();
  const [filtroAtivo, setFiltroAtivo] = useState('Pendente');
  
  const tarefas = [
    {
      id: 1,
      titulo: 'Estudar Node.js',
      prazo: '2025-05-25',
      status: 'Pendente'
    },
    {
      id: 2,
      titulo: 'Revisar Documentação do Projeto',
      prazo: '2025-05-26',
      status: 'Pendente'
    },
    {
      id: 3,
      titulo: 'Preparar Apresentação para o Cliente',
      prazo: '2025-05-27',
      status: 'Em andamento'
    },
    {
      id: 4,
      titulo: 'Participar da Reunião de Planejamento',
      prazo: '2025-05-28',
      status: 'Pendente'
    },
    {
      id: 5,
      titulo: 'Atualizar o Plano de Projeto',
      prazo: '2025-05-29',
      status: 'Concluída'
    }
  ];

  const filtros = ['Pendente', 'Em andamento', 'Concluída', 'Todas as Categorias'];

  const tarefasFiltradas = filtroAtivo === 'Todas as Categorias' 
    ? tarefas 
    : tarefas.filter(tarefa => tarefa.status === filtroAtivo);

  const handleNovaTarefa = () => {
    navigate('/nova-tarefa');
  };

  const handleEditarTarefa = (id) => {
    navigate(`/editar-tarefa/${id}`);
  };

  return (
    <div className="px-40 flex flex-1 justify-center py-5">
      <div className="layout-content-container flex flex-col max-w-[960px] flex-1">
        <div className="flex flex-wrap justify-between gap-3 p-4">
          <p className="text-[#0d141c] tracking-light text-[32px] font-bold leading-tight min-w-72">Minhas Tarefas</p>
          <button
            onClick={handleNovaTarefa}
            className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-8 px-4 bg-[#e7edf4] text-[#0d141c] text-sm font-medium leading-normal hover:bg-[#d0dae5] transition-colors"
          >
            <span className="truncate">Nova Tarefa</span>
          </button>
        </div>
        
        <div className="pb-3">
          <div className="flex border-b border-[#cedbe8] px-4 gap-8">
            {filtros.map((filtro) => (
              <button
                key={filtro}
                onClick={() => setFiltroAtivo(filtro)}
                className={`flex flex-col items-center justify-center border-b-[3px] pb-[13px] pt-4 transition-colors ${
                  filtroAtivo === filtro
                    ? 'border-b-[#0c7ff2] text-[#0d141c]'
                    : 'border-b-transparent text-[#49739c] hover:text-[#0d141c]'
                }`}
              >
                <p className="text-sm font-bold leading-normal tracking-[0.015em]">{filtro}</p>
              </button>
            ))}
          </div>
        </div>

        <div className="flex flex-col gap-4">
          {tarefasFiltradas.length === 0 ? (
            <div className="p-4 text-center text-[#49739c]">
              <p>Nenhuma tarefa encontrada para este filtro.</p>
            </div>
          ) : (
            tarefasFiltradas.map((tarefa) => (
              <div key={tarefa.id} className="p-4">
                <div className="flex items-stretch justify-between gap-4 rounded-lg border border-[#e7edf4] p-4 hover:shadow-md transition-shadow">
                  <div className="flex flex-[2_2_0px] flex-col gap-4">
                    <div className="flex flex-col gap-1">
                      <p className="text-[#0d141c] text-base font-bold leading-tight">{tarefa.titulo}</p>
                      <p className="text-[#49739c] text-sm font-normal leading-normal">Prazo: {tarefa.prazo}</p>
                      <p className="text-[#49739c] text-sm font-normal leading-normal">Status: {tarefa.status}</p>
                    </div>
                    <button
                      onClick={() => handleEditarTarefa(tarefa.id)}
                      className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-8 px-4 flex-row-reverse bg-[#e7edf4] text-[#0d141c] text-sm font-medium leading-normal w-fit hover:bg-[#d0dae5] transition-colors"
                    >
                      <span className="truncate">Editar</span>
                    </button>
                  </div>
                  <div className="w-full bg-center bg-no-repeat aspect-video bg-cover rounded-lg flex-1 bg-[#f8fafc] border border-[#e7edf4] flex items-center justify-center">
                    <span className="text-[#49739c] text-sm">Sem imagem</span>
                  </div>
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </div>
  );
};

export default MinhasTarefas;
